<!doctype html>
<html lang="zh-CN">
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width,initial-scale=1">
  <title>上海建科检验有限公司</title>
  <style>
    :root{ --max-width: 1380px; --label-w: 260px; --row-h: 66px; --dot: #e9e9e9; --label-color: #9fa6ab; --value-color: #333; --accent: #1677ff; --font-sans: -apple-system, BlinkMacSystemFont, 'PingFang SC', 'Microsoft YaHei', 'Helvetica Neue', Arial; }
    *{box-sizing:border-box}
    html,body{height:100%;margin:0;padding:0;background:#ffffff;font-family:var(--font-sans);color:var(--value-color);}
    .page{max-width:var(--max-width);margin:0 auto;padding:16px 18px 80px;}
   
    /* logo centered on top */
    .brand{display:flex;justify-content:center;align-items:center;padding:10px 0 18px;}
    .brand img{width:890px;max-width:92vw;height:auto;display:block;line-height:0;}

    /* small blue left label */
    .valid{color:var(--accent);font-size:14px;margin:8px 0 14px;padding-left:4px;font-weight:600;}

    /* info list */
    .info{border-top:1px dotted var(--dot);}
    .row{display:flex;flex-direction: column;align-items:flex-start;border-bottom:1px dotted var(--dot);padding:8px 6px;}
    .label{flex:none;color:var(--value-color);font-size:14px;margin-bottom: 2px;}
    .value{color:var(--label-color);font-size:14px;}

    /* the last rows may contain longer text wrapped */
    .value.wrap{white-space:normal;}

    /* bottom download */
    .download{margin-top:12px;padding-left:6px;font-size:13px;}
    .download a{color:var(--accent);text-decoration:none;}

    /* responsiveness */
    @media (max-width:800px){:root{--label-w:160px;--row-h:62px} .brand img{width:86vw}}
  </style>
</head>
